    divisors = getDivisors(N)
    ones = sum(arr)
    minm = 1000000000
    for d in divisors:
        freq = {}
        for i in range(d):
            freq[i] = sum(arr[i:N:d])
        req = N // d
        for i in range(d):
            ans = req - freq[i] + ones - freq[i]
            minm = min(minm, ans)
    return minm

def getDivisors(n):
    divisors = set()
    for i in range(1, int(n ** 1) + 1):
        if n % i == 0:
            divisors.add(i)
            divisors.add(n // i)
    return divisors

